import React from 'react';
import {useRouter} from 'next/router';
import Link from 'next/link';

function HomePage() {
    return (
    <>
      <div>Welcome to Sponge.id Web App!</div>
      <Link href="/register">
          <a>Register</a>
        </Link>
      </>
      )
  }
  
export default HomePage;
